import React from "react";
import { View, StyleSheet, Image } from "react-native";

function GameCard({ card, onPress }) {
	return (
		<View style={styles.container}>
			{/* <Image style={styles.image} source={{uri: card.image}} /> */}
			<Image
				style={styles.cardFace}
				source={require("../assets/cards/card_back.png")}
			/>
			<Image
				style={styles.cardFace}
				source={require("../assets/cards/card_front.png")}
			/>
			<Image style={styles.card} source={card.image} />
		</View>
	);
}

const styles = StyleSheet.create({
	container: {},
	card: {},
	cardFace: {
		position: "absolute",
	},
});

export default GameCard;
